import React, { useState } from "react"
import styled from "styled-components"
import { Link, useNavigate } from "react-router-dom";


export default function Home() {
    return(
        <>
            <FormContainer>
                <div className="navbar-top-space">
                    <div className="container">

                    </div>
                </div>
            </FormContainer>
        </>
    )
}
const FormContainer = styled.div`
height: 100vh;
width: 100vw;
display: flex;
flex-direction: column;
align-items: center;
gap: 1rem;
background-color: #e8f3ff;
.navbar-top-space{
    height: 10vh;
    width: 100vw;
    display: block;
    top: 0;
    z-index: 999;
    background-color:linear-gradient(to bottom, rgb(0 0 0 / 90%) , hsl(0deg 0% 0% / 0%));
}
.container{
    margin-left: auto;
    margin-right: auto;
    width: 80vw
    height: 10vh
    background-color: yellow;
    display:block;
}
`;
